// src/HorseDetailsPage.tsx

import React, { useState } from 'react';

const HorseDetailsPage: React.FC = () => {
    const [height, setHeight] = useState('');
    const [weight, setWeight] = useState('');
    const [race, setRace] = useState('');

    const handleSubmit = () => {
        // Handle save logic here
        alert('جزئیات ذخیره شد!');
    }

    return (
        <div>
            <h1>جزئیات اسب</h1>
            <div>
                <label>ارتفاع: </label>
                <input type="text" value={height} onChange={(e) => setHeight(e.target.value)} />
            </div>
            <div>
                <label>وزن: </label>
                <input type="text" value={weight} onChange={(e) => setWeight(e.target.value)} />
            </div>
            <div>
                <label>نژاد: </label>
                <input type="text" value={race} onChange={(e) => setRace(e.target.value)} />
            </div>
            <button onClick={handleSubmit}>ذخیره</button>
        </div>
    );
}

export default HorseDetailsPage;
